import React from "react";

function TimeTable({ data }) {
    return (
        <table>
            <tr>
                <th>Day</th>
                <th>Time</th>
            </tr>
            {data.map(item => {
                return (
                    <tr>
                        <td>item.day</td>
                        <td>item.time</td>
                    </tr>
                );
            })}
        </table>
    );
}

export default TimeTable;
